import React from 'react';
import styled from "styled-components"
import BrightnessLowRoundedIcon from '@material-ui/icons/BrightnessLowRounded';

const AppContainer = styled.div `
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-items: center;
`
const DivCassete = styled.div`

  background-color: #1B1B1F;
  display: flex;
  flex-direction: column;
  position: relative;
  border-radius: 20px;
  height: 350px;
  width: 550px;
  margin-top: 200px;
  box-shadow: 0px 50px 20px rgba(0,0,0,0.2);
`
const DivCircleAnimation = styled.div`

    font-size: 150px;
    height: 170px;
    width: 170px;
    border-radius: 50%;
    border: 10px solid #1B1B1F;
    display: flex;
    align-items: center;
    justify-content: center;

`

const DivStamp = styled.div`
  position: relative;
  display: flex;
  flex-direction: column-reverse;
  height: 300px;
  width: 95%;
  margin: auto;
  margin-top: 30px;
  background-color: #F2EFE4;
  border-radius: 20px;
  z-index: 2;
  overflow: hidden;
`
const DivAnimation = styled.div`

  width: 75%;
  margin: auto;
  height: 55%;
  position: absolute;
  top: 60px;
  right: 70px;
  background-color:#F2EFE4;
  border-radius: 10px;
  overflow: hidden;


`

const DivCasseteBottom = styled.div`
  width: 60%;
  margin: auto;
  background-color:#1B1B1F;

  height: 25%;
  border-left: 60px solid #1B1B1F;
  border-right: 60px solid #1B1B1F;
  border-bottom: 60px solid #202020;
  border-top: 0px solid black;
  margin-top:-30px;
  margin-bottom: 10px;
  z-index: 1;
`
const Circle = styled.div`

  height: 40px;
  width: 40px;
  border-radius: 50%;
  background-color: #4D4D59;

`
const DivCircle = styled.div`
  width: 100%;
  position: absolute;
  bottom: 14px;
  display: flex;
  align-items: center;
  justify-content: space-evenly;
  z-index: 3; 
`
const DivLine = styled.div`

    background-color: ${props=> props.bkColor};
    height: ${props=>props.height};
    margin-top: 2px;

`

const App = () => {
  return (
    <AppContainer>
      <DivCassete>
        <DivStamp>
          <DivAnimation/>
          <DivLine bkColor='#F24141' height='20%'/>
          <DivLine bkColor='#F24141' height='15%'/>
          <DivLine bkColor='#F2C063' height='15%'/>
          <DivLine bkColor='#F2C063' height='10%'/>
          <DivLine bkColor='#41A69C' height='10%'/>
          <DivLine bkColor='#41A69C' height='5%'/>
        </DivStamp>
        <DivCasseteBottom>
        </DivCasseteBottom>
      <DivCircle>
      <Circle/>
          <Circle/>
          <Circle/>
      </DivCircle>
      </DivCassete>

    </AppContainer>
  );
}


export default App;
